      "created_at" : "Wed Jan 13 20:16:10 +0000 2021",
      "favorited" : false,
      "full_text" : "Long story short, magic is bad. Avoid it. Keep your apis simple, explicit, and predictable.\n\n#javascript #reactjs #webdev",
      "lang" : "en",
      "in_reply_to_screen_name" : "austin_malerba",
